import React from 'react';
import PageNavBar from './PageNavBar';
import './Page.css';
import { topics } from './Topics';

function Page({ unit, index, title }) {
    const pages = [
        [
            (
                <>
                    <p>unit 1 first page :)</p>
                </>
            ),
            (
                <>
                    <p>unit 1 second page :)</p>
                </>
            ),
        ],
        [
            (
                <>
                    <p>unit 2 first page :)</p>
                </>
            ),
            (
                <>
                    <p>unit 2 second page :)</p>
                </>
            ),
        ]
    ];

    let currPage;
    let pageList;
    if (unit - 1 < pages.length && index - 1 < pages[unit - 1].length){
        currPage = pages[unit - 1][index - 1];
        pageList = pages[unit - 1];
    }
    else{
        currPage = <p>Page does not exist :(</p>;
    }

    return (
        <div className="page">
            <PageNavBar currPage={currPage} pageList={pageList} topics={topicList}/>
            <h3>{title}</h3>
            {currPage}
        </div>
    )
}
export default Page;
